import PropTypes from 'prop-types';

const Page = ({ children }) => (
  <div>
    <h2>I am the page component</h2>
    {children}
  </div>
);

Page.propTypes = {
  children: PropTypes.arrayOf(propTypes.no),
};

export default Page;
